import './App.css';
import { Layout } from './components/Layout';
import  Header  from './components/Header/Header' ;
import Board from './views/Board';
import DateRangePicker from './components/Calendar';

function App() {
  return (
    <div className="App">
      <Header/>
      <Layout>
        <Board/>
        <DateRangePicker/>
      </Layout>
    </div>
  );
}

export default App;
